      }

      @include onDesktop {
        display: none;
      }
    }

    &--image-desktop {
      display: none;

      @include onDesktop {
        display: block;
      }
    }

    &--button {

      &--link {
        width: max-content;
        display: block;
        font-weight: 700;
        font-size: 12px;
        line-height: 14px;
        text-transform: uppercase;
        color: $colorAzure;
        text-decoration: none;
